import React from 'react';
import styled from '@emotion/styled';
import terminalpng from '../Images/terminal.png';
const TitleDiv = styled.div `
  z-index: -1;
  position: fixed;
  color: white;
  top: 0px;
  height: 100vh;
  width: 100%;
  display: inline-block;
  font-weight: 400;
  background-color: black;  
`;

const Terminal = styled.div`

`;
const TopBar = styled.div`
  background-color: gray;
`;
const Dot = styled.span`
  height: 25px;
  width: 25px;
  background-color: red;
  border-radius: 50%;
  display: inline-block;
`;

function Title() {
  return (
    <React.Fragment>
      <TitleDiv>
        <Terminal>
          <TopBar>
            <Dot></Dot>
            <Dot></Dot>
            <Dot></Dot>
          </TopBar>
        </Terminal>

      </TitleDiv>
      
      
    </React.Fragment>
  );
}

export default Title;
